import React from "react";
import { Typography, Paper } from "@material-ui/core";

export const about = () => {
    return (
        <Paper elevation={3}>
            <Typography>
                <ul>
                    <li>List 1</li>
                    <li>List 2</li>
                    <li>List 3</li>
                    <li>List 4</li>
                </ul>
            </Typography>
        </Paper>
    )
}

export default about;
